  .show-for-dark-mode {
    display: none;
  }
  .hide-for-dark-mode {
    display: block;
  }
  @media screen and (prefers-color-scheme: dark) {
    .show-for-dark-mode {
      display: block !important;
    }
    .hide-for-dark-mode {
      display: none !important;
