header {
    width: 100%;
    position: sticky;
    top: 0;
    z-index: 100;

    .title-bar {
        background: $black;
        padding: 15px 20px;
        position: relative;

        .logo-container {
            padding-top: 0;
            text-align: center;

            a {
              display: block;
              width: 69px;
            }

            img {
                width: 100%;
                height: auto;
            }
        }

        .menu-toggle {
            position: absolute;
            right: 15px;
            top: 50%;
            transform: translateY(-50%);
            width: 30px;
            height: 77px;
            cursor: pointer !important;

            &.is-open {
              .open {
                .menu-line {
                  display: none !important;
                }
                .close {
                  display: flex !important;
                }
              }
            }

            .open {
              width: 100%;
              height: 100%;
              display: flex;
              flex-direction: column;
              align-items: center;
              justify-content: center;

              .menu-line {
                display: block;
                width: 100%;
                height: 4px;
                background: $white;
                z-index: 5;
                margin: 3px 0;
                border-radius: 4px;
              }
            }

            .close {
              position: fixed;
              right: 0;
              top: 0;
              width: 100%;
              height: 100%;
              display: flex;
              flex-direction: column;
              align-items: center;
              justify-content: center;
              display: none;
              z-index: 400;
              cursor: pointer !important;


              &:before {
                content: '';
                position: absolute;
                top: 50%;
                left: 50%;
                transform: translate(-50%, -50%) rotate(-45deg);
                width: 4px;
                height: 10px;
                background: $black;
                z-index: 2;
              }

              &:after {
                content: '';
                position: absolute;
                top: 50%;
                left: 50%;
                transform: translate(-50%, -50%) rotate(-45deg);
                width: 10px;
                height: 4px;
                background: $black;
                z-index: 2;
              }
            }
          }
    }

    .header-bar {
        display: flex;
        flex-direction: row;
        justify-content: space-between;
        align-items: center;
        background: $black;
        padding: 10px 20px;

        @include mq(large, 'max') {
          padding: 10px 0 0;
        }

        .logo-container {
          padding-top: 0;
          text-align: center;

          a {
            display: block;
            width: 69px;
          }

          img {
              width: 100%;
              height: auto;
          }
      }

        .menu-wrap {
            display: flex;
            align-items: center;

            .menu {
                align-items: center;

                .sub-menu {
                  display: none;
                }
            }

            .social {
                display: flex;
                align-items: center;

                a {
                    margin: 0 8px;

                    img {
                        transition: .25s ease-out;
                    }

                    &:hover {
                        img {
                            opacity: 0.7;
                        }
                    }
                }
            }
        }

        @include mq(large, 'max') {
            position: fixed;
            top: 0;
            left: 0;
            width: 100%;
            height: 100vh;
            align-items: flex-start;
            z-index: 3;
            overflow-y: scroll;

            .mobile-menu {
              position: relative;
              width: 100%;

              .menu-header {
                position: relative;
                background: $black;
                display: flex;
                width: 100%;
                height: 78px;
                display: flex;
                align-items: center;
                padding: 0 20px;
              }

              .menu-links {
                width: 100%;
                height: 100%;
                min-height: calc(100vh - 186px - 98px);
                position: relative;
                margin-top: 10px;
                background: $black;
                padding: 20px 40px 30px;
                display: flex;
                flex-direction: column;
                justify-content: center;
                align-items: center;


                .menu {
                  align-items: flex-start;
                  flex-direction: column;
                  width: 100%;

                  .menu-item {
                    &.menu-item-has-children {
                      a:not(.sub-anchor) {
                        pointer-events: none;
                      }

                      &:hover {
                        .sub-menu {
                          display: flex !important;
                        }

                        a:nth-child(1) {
                          color: $black;

                          .arrow {
                            top: 6px;
                            border-right: 0.15em solid $black;
                            border-top: 0.15em solid $black;
                            transform: rotate(-45deg);
                          }
                      }
                    }

                      a:nth-child(1){
                        display: inline-block;
                        position: relative;

                        .arrow {
                          position: absolute;
                          right: -32px;
                          top: 1px;
                          display: inline-block;
                          width: 0.5em;
                          height: 0.5em;
                          border-right: 0.15em solid $white;
                          border-top: 0.15em solid $white;
                          transform: rotate(135deg);
                          margin-right: 0.5em;
                          transition: .25s ease-in-out;
                        }
                      }

                      .sub-menu {
                        flex-direction: column;
                        padding-bottom: 20px;
                        align-items: flex-start;
                        display: none;

                        a {
                          font-size: 13px !important;
                          color: $white !important;

                          &:hover,
                          &:active,
                          &:focus,
                          &:visited {
                            a {
                              color: $white !important;
                            }
                          }

                          &:after {
                            display: none;
                          }
                        }
                      }
                    }

                    &.btn a {
                      background-color: transparent !important;
                      border: none !important;
                      padding: 0 !important;
                    }

                    a {
                      font-size: 24px;
                      text-transform: uppercase;
                      margin: 10px 0
                    }
                  }
                }
              }

              .directions {
                width: 100%;
                display: flex;
                align-items: center;
                justify-content: center;
                color: $white;
                padding: 10px 30px;
                align-self: flex-end;
                height: 186px;

                img {
                  width: 166px;
                }

                .content-right {
                  max-width: 132px;

                  .btn-hollow {
                    margin-top: 10px;
                  }
                }
              }
            }

            .social {
                order: 3;
                margin-top: 10px;

                a {
                    margin: 0 5px 0 0;

                    img {
                      width: 30px;
                    }
                }
            }

            .menu-wrap {
                order: 2;
                margin-bottom: 40px;

                ul {
                    flex-direction: column;
                    justify-content: center;
                    align-items: center;

                    a {
                        font-size: 30px;
                    }
                }
            }

            .close {
                position: fixed;
                right: 10px;
                top: 30px;
                width: 40px;
                height: 30px;
                display: flex;
                flex-direction: column;
                align-items: center;
                justify-content: center;
                z-index: 400;
                cursor: pointer !important;


                &:before {
                  content: '';
                  position: absolute;
                  top: 50%;
                  left: 50%;
                  transform: translate(-50%, -50%) rotate(-45deg);
                  width: 4px;
                  height: 40px;
                  background: $white;
                  z-index: 4;
                  border-radius: 4px;
                }

                &:after {
                  content: '';
                  position: absolute;
                  top: 50%;
                  left: 50%;
                  transform: translate(-50%, -50%) rotate(-45deg);
                  width: 40px;
                  height: 4px;
                  background: $white;
                  z-index: 4;
                  border-radius: 4px;
                }
              }
        }
    }

    .menu-item {
        &.active {
            a {
                color: $white;

                &:after {
                    height: 4px;
                }
            }
        }

        a {
            position: relative;
            padding: 0;
            margin: 0 10px;
        }
    }
}

