.contact-us {
    padding: 80px 0 120px;

    @include mq(large, 'max') {
        padding: 40px 0 100px;
    }

    .wrapper {
        padding: 0 30px;

        @include mq(large, 'max') {
            padding: 0 10px;
        }
    }

    .intro-content {
        padding-bottom: 60px;
        .heading-1 {
            display: block;
        }

        p {
            padding-top: 10px;
        }
    }

    fieldset {
        display: flex;
        justify-content: space-between;
        align-items: center;
        flex-wrap: wrap;

        .large {
            width: 100%;
        }
        .medium {
            width: calc(50% - 15px);
        }
        .small {
            width: 33.33%;
        }

        @include mq(large, 'max') {
            .large,
            .medium,
            .small {
                width: 100%;
            }
        }
    }

    .form {
        padding-top: 0 !important;

        form {
            .wpcf7-list-item {
                margin: 0;
            }

            .wpcf7-not-valid-tip {
                color: $black;
                font-weight: bold;
            }

            label {
                &[for="file"] {
                    position: relative;
                    margin-top: 20px;

                    input[type="file"] {
                        position: absolute;
                        z-index: -1;
                        top: 10px;
                        left: 8px;
                        font-size: 17px;
                        visibility: hidden;
                    }
                }

                &[for="acceptance"] {
                    margin: 20px 0;
                }

                .file-button {
                    display: inline-block;
                    padding: 7px 15px 5px !important;
                    cursor: pointer;
                    border: 1px solid $white !important;
                    border-radius: 25px !important;
                    background-color: transparent !important;
                    font-size: 15px !important;
                    color: #fff
                }
            }

            input:-webkit-autofill,
            input:-webkit-autofill:hover, 
            input:-webkit-autofill:focus,
            textarea:-webkit-autofill,
            textarea:-webkit-autofill:hover,
            textarea:-webkit-autofill:focus,
            select:-webkit-autofill,
            select:-webkit-autofill:hover,
            select:-webkit-autofill:focus {
            border: 1px solid $white;
            -webkit-text-fill-color: $white;
            -webkit-box-shadow: 0 0 0px 1000px $black inset;
            transition: background-color 5000s ease-in-out 0s;
            }

            input[type="checkbox"] {
                margin-bottom: 0;
            }

            input[type="email"],
            input[type="tel"],
            input[type="text"],
            input[type="date"],
            select {
                border: 1px solid $white;
                background: transparent !important;
                width: 100%;
                height: 50px;
                color: $white;

                &::placeholder {
                    font-weight: 600;
                    font-style: normal;
                }

                &:focus,
                &:active {
                    background-color: transparent !important;
                }
            }

            textarea {
                border: 1px solid $white;
                background: transparent;
                width: 100%;
                color: $white;

                &::placeholder {
                    font-weight: 600;
                    font-style: normal;
                }
            }

            .wpcf7-submit {
                margin-top: 20px;
                cursor: pointer;
            }
        }
    }
}

